    <div className="container mt-3">
      <div className="row">
        <div className="col-md-7 my-auto">
          <img className="img-fluid w-100" src={rocketImg} alt=""/>
          <h5>Choose a date range</h5>
          <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Hic doloribus temporibus veniam molestiae minima ut quia repellendus perspiciatis, aperiam vero fuga ipsa magni aut eligendi. Et explicabo adipisci amet pariatur?</p>
        </div>
        <div className="col-md-5">
          <Signup />
        </div>
      </div>
    </div>
  );
}

export default App;
